    false,nt"url": null,nt"notes": "This narrative report for Seney National
    Wildlife Refuge outlines Refuge accomplishments from November of 1941 through January
    of 1942. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, and fish- is also
    covered. The Refuge development and maintenance section discusses physical developments,
    plantings, and wildfires. The public relations section of the report describes recreational
    uses and Refuge visitors.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
